import "./addProjectPopUp.css"
import React, { Component } from 'react';
import Modal from 'react-awesome-modal';

export default class AddProjectPopUp extends Component {
    constructor(props) {
        super(props);
        this.state = {
            visible : false,
            name: null,
            server: null,
            folder: null
        }
    }
    async openModal() {  
        this.setState({
            visible : true,
        });
    }

    closeModal() {
        this.setState({
            visible : false,
        });
    }

    addProject(){

    }

    render() {
        return (
            <section style={{float:"left"}}>
                <button value="Force claim" className="action__btn"  onClick={() => this.openModal()}>Add project</button>               
                <div>
                    <Modal visible={this.state.visible} width="650" height="180" effect="fadeInUp" onClickAway={() => this.closeModal()}>
                        <div className="popUp__container" >
                            <center className="popUp__title"><h1>Add project</h1></center>          
                        </div>
                        <div className="selector__container">

                            <input type="text" placeholder="Project name" id="name" className="popUp__input__text" value={this.state.name} onChange={(e) => this.setState({name: e.target.value})} ></input>
                            <input type="text" placeholder="Server" id="server" className="popUp__input__text" value={this.state.server} onChange={(e) => this.setState({server: e.target.value})} ></input>
                            <input type="text" placeholder="Folder" id="foder" className="popUp__input__text" value={this.state.name} onChange={(e) => this.setState({name: e.target.value})} ></input>                            
                                
                            <button class="btn btn-sm btn-success" style={{fontSize:"15px"}} onClick={()=>this.addProject()}>Save</button>
                        </div>
                    </Modal>
                </div>
            </section>
            
        );
    }
}
